import styled from 'styled-components';

export const Container = styled.div`
  nav {
    display: flex;
    flex-direction: row;
    margin: 20px 0;
    text-align: center;

    text {
      margin: 0px 40px;
    }
    img {
      margin: 0px 20px;
      width: 150px;
      height: 50px;
    }
  }
`;
